     &    45.D0*Hr1(0)*z2*x + 3752.D0/15.D0*Hr1(0)*z2*x**2 + 1504.D0/15.
     &    D0*Hr1(0)*z2*x**3 + 688.D0/5.D0*Hr1(0)*z2*dx - 7624.D0/15.D0*
