     &    Hr1(1)*z3*x - 752.D0/3.D0*Hr1(1)*z3*x**2 + 392.D0/5.D0*Hr1(1)
     &    *z3*x**3 - 376.D0/3.D0*Hr1(1)*z3*dx + 784.D0/15.D0*Hr1(1)*z3*
